  \"The Coral Reef Temperature Anomaly Database (CoRTAD) - Global, 4 km, Sea Surface
  Temperature and Related Thermal Stress Metrics for 1985-2005 (NODC Accession 0044419)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:59.531107\",\n\t\"name\": \"the-coral-reef-temperature-anomaly-database-cortad-global-4-km-sea-surface-temperature-and\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Coral Reef Temperature Anomaly Database
  (CoRTAD) is a collection of sea surface temperature (SST) and related thermal stress
  metrics, developed specifically for coral reef ecosystem applications but relevant
  to other ecosystems as well. The CoRTAD contains global, approximately 4 km resolution
  SST data on a weekly time scale from 1985 through 2005. In addition to SST, it contains
  SST anomaly (SSTA, weekly SST minus weekly climatological SST), thermal stress anomaly
  (TSA, weekly SST minus the maximum weekly climatological SST), SSTA Degree Heating
  Week (SSTA_DHW, sum of previous 12 weeks when SSTA >= 1 degree C), SSTA Frequency
  (number of times over previous 52 weeks that SSTA >= 1 degree C), TSA DHW (TSA_DHW,
  also known as a Degree Heating Week, sum of previous 12 weeks when TSA >= 1 degree
  C),and TSA Frequency (number of times over previous 52 weeks that TSA >= 1 degree
  C).The CoRTAD was created at the NOAA National Oceanographic Data Center in partnership
  with the University of North Carolina - Chapel Hill, with support from the NOAA
  Coral Reef Conservation Program.To provide sea surface temperature data and related
  thermal stress parameters with good temporal consistency, high accuracy, and fine
  spatial resolution. The CoRTAD is intended primarily for climate and ecosystem related
  applications and studies and was designed specifically to address questions concerning
  the relationship between coral disease and bleaching and temperature stress.\",\n\t\"license_title\":
